# 1 "CLex.fsl"
 
 (* File MicroC/CLex.lex
    Lexer specification for micro-C, a small imperative language
  *)

module CLex

open Microsoft.FSharp.Text.Lexing
open CPar;

let lexemeAsString lexbuf =
    LexBuffer<char>.LexemeString lexbuf
                                                    (*add*)
let octalToDecimal value=
    let rec toList value n =
        if value=0 then n else toList (value/10) ((value%10)::n)
    let rec pow n =
        if n=0 then 1
        else 8 * (pow (n-1))
    let rec len xs =
        match xs with
        | []-> 0
        | x::xr->1 + len xr
    let rec eval (n: int list) =
        match n with
        | [] -> 0
        | xr::yr -> xr * pow (len yr) + eval yr
    eval (toList value [])
let hexaToDecimal value = 
    let rec hexaToList (str:string)  = 
        if(str.Length <= 0) then []
        else
            match str.[0] with
            | _ when str.[0] >='a' && str.[0] <= 'f'    -> (int str.[0]) - ( int 'a') + 10::hexaToList str.[1..str.Length - 1]
            | _ when str.[0] >= 'A' && str.[0] <= 'F'   -> (int str.[0]) - ( int 'A') + 10::hexaToList str.[1..str.Length - 1]
            | _ when str.[0] >= '0' && str.[0] <= '9'   -> (int str.[0]) - ( int '0') ::hexaToList str.[1..str.Length - 1]
            | _                                         ->failwith ""
    let result = hexaToList (value)
    let mutable num = 0;
    List.iter(fun i -> num <- num*16 + i)result
    num

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)

let keyword s =
    match s with
    | "break"   -> BREAK
    | "case"    -> CASE
    | "char"    -> CHAR
    | "do"      -> DO
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "for"     -> FOR
    | "in"      -> IN
    | "if"      -> IF
    | "int"     -> INT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "switch"  -> SWITCH
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID
    | "while"   -> WHILE
    | _         -> NAME s

let radix (s:string) =
    match s.[0..1] with
    | "0o"
    | "0x" ->   s.[2..(s.Length)-1] 
    | _    ->   failwith "Lexer error: no such radix"

let cEscape s =
    match s with
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

